commits.sourceNew:
@Override
public Object toObject(IndexableField f) {
  final Number val = f.numericValue();
  if (val != null) {
    return val;
  } else {
    throw new AssertionError("Unexpected state. Field: '" + f + "'");
  }
}

@Override
public Object toObject(IndexableField f) {
  final Number val = f.numericValue();
  if (val != null) {
    return val.intValue();
  } else {
    throw new AssertionError("Unexpected state. Field: '" + f + "'");
  }
}

